import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const ExamsForUser = () => {
  const [exams, setExams] = useState([]);
  const navigate = useNavigate();
  const partyId = "10040";
  useEffect(() => {
    fetch(`https://localhost:8443/onlineexam/control/showExamsForPartyId`, {
      method: "POST",
      headers: { "Content-type": "application/json" },
      credentials: "include",
      body: JSON.stringify({ partyId }),
    })
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log("data.examlist::::", data.examList);
        setExams(data.examList);
      });
  }, []);

  return (
    <div className="container-fluid ">
      <div className="container-fluid border-bottom border-dark border-3">
        <h2 className="p-2 ">Scheduled Exams</h2>
      </div>

      <div class="accordion mt-1" id="accordionExample">
        <div class="accordion-item">
          <h2 class="accordion-header" id="headingOne">
            <div class="py-3 px-3">
              <h5>Java Exam</h5>
              <div className="  row ">
              <button   onClick={()=>onEdit(object[id])} className="btn btn-outline-success  btn-sm me-4 col">Edit</button>
              <button onClick={()=>onDelete(object[id])} className="btn btn-outline-danger btn-sm me-3 col ">Delete</button>
            </div>
            </div>
          </h2>
        </div>
      </div>
      {exams.map((exam) => (
        <div className="container col-6 border rounded bg-secondary ">
          <h4>
            {exam.examName}
            <span className="offset-7 ">
              <button
                className="mt-3 btn bg-primary"
                onClick={() => navigate("/introduction")}
              >
                Take Exam
              </button>
            </span>
          </h4>
        </div>
      ))}
    </div>
  );
};

export default ExamsForUser;
